	('eba5f209-fb5d-11f0-87db-c3c8a1ce2650', '218e8243-6e03-41b3-a551-65936bd12815', '[\n  {"type":"hero","title":"Teknologi & Presisi","content":"Akun Ngekode memadukan latihan panahan dengan pendekatan teknologi dan analitik untuk meningkatkan performa atlet."},\n  {"type":"about","title":"Tentang Akun Ngekode","content":"Berbasis di Jakarta, fokus pada pengembangan atlet muda dengan kurikulum modern dan sesi review berbasis data."},\n  {"type":"gallery","title":"Galeri","images":"https://picsum.photos/id/311/800/500, https://picsum.photos/id/312/800/500, https://picsum.photos/id/313/800/500"},\n  {"type":"testimonials","title":"Testimoni","items":[{"author":"Rizky","text":"Program analitiknya membantu saya konsisten di 70m."},{"author":"Salsa","text":"Pelatihnya detail dan komunikatif."}]}\n]', '2026-01-27 08:55:28', '2026-01-27 08:55:28'),
