	('eba5f816-fb5d-11f0-87db-c3c8a1ce2650', '5443f8d7-fb21-11f0-87db-c3c8a1ce2650', '[\n  {"type":"hero","title":"Makassar Archery Club","content":"Klub profesional Makassar dengan kombinasi range outdoor & indoor."},\n  {"type":"about","title":"Tentang MAC","content":"Fokus pengembangan atlet muda Sulawesi Selatan, menyediakan beasiswa prestasi."},\n  {"type":"gallery","title":"Galeri","images":"https://picsum.photos/id/361/800/500, https://picsum.photos/id/362/800/500"},\n  {"type":"testimonials","title":"Testimoni","items":[{"author":"Rani","text":"Pelatihan disiplin dan terstruktur."},{"author":"Ilham","text":"Fasilitas peralatan terawat."}]}\n]', '2026-01-27 08:55:28', '2026-01-27 08:55:28');
