	('4a40793e-f935-11f0-87db-c3c8a1ce2650', 'sumatra-archery-championship-2025', 'EVT-007', 'Sumatra Archery Championship 2025', NULL, 'GOR H. Agus Salim', 'https://maps.app.goo.gl/examplePadang', 'Palembang', 'Jl. Veteran, Padang, Sumatera Barat', 'Padang', '2026-02-03 06:59:35', '2026-02-06 06:59:35', '2026-01-31 06:59:35', 'Sumatra Archery Championship 2025 adalah kompetisi panahan regional yang mengundang pemanah dari seluruh pulau Sumatera. Event ini menjadi ajang silaturahmi dan kompetisi antar klub panahan se-Sumatera.', NULL, NULL, NULL, 1, 1, 250000.00, 350, 'published', 'a1fdd1c4-632a-44d9-9be4-c96461e4530e', '2026-01-24 14:59:35', '2026-01-28 13:14:33', 25000000.00, 'https://archeryhub.id/docs/tpk-sumatra-2025.pdf', '{"sections":{"about":true,"divisions":true,"fees":true,"prizes":true,"schedule":true,"location":true},"prizes":{"first":"Rp 4.000.000","second":"Rp 2.500.000","third":"Rp 1.500.000"}}'),
	('4b2a017e-f935-11f0-87db-c3c8a1ce2650', 'kalimantan-open-archery-2025', 'EVT-008', 'Kalimantan Open Archery 2025', NULL, 'Stadion Panahan Palangkaraya', 'https://maps.app.goo.gl/exampleKalimantan', 'Pontianak', 'Jl. Tjilik Riwut Km 7,5 Palangkaraya, Kalimantan Tengah', 'Palangkaraya', '2026-02-08 06:59:36', '2026-02-11 06:59:36', '2026-02-05 06:59:36', 'Kalimantan Open Archery 2025 adalah kompetisi panahan terbuka tingkat nasional yang diselenggarakan di Kalimantan. Event ini menghadirkan peserta dari berbagai daerah di Indonesia untuk berkompetisi dalam berbagai kategori usia dan jenis busur. Kompetisi ini juga menjadi ajang seleksi atlet daerah untuk kejuaraan nasional.', NULL, NULL, NULL, 1, 1, 500000.00, 400, 'published', 'a1fdd1c4-632a-44d9-9be4-c96461e4530e', '2026-01-24 14:59:36', '2026-01-28 13:14:37', 20000000.00, 'https://archeryhub.id/docs/tpk-kalimantan-2025.pdf', '{"sections":{"about":true,"divisions":true,"fees":true,"prizes":true,"schedule":true,"location":true},"prizes":{"first":"Rp 5.000.000 + Medali Emas","second":"Rp 3.000.000 + Medali Perak","third":"Rp 2.000.000 + Medali Perunggu"}}'),
	('63457f65-f934-11f0-87db-c3c8a1ce2650', 'jakarta-open-championship-2025', 'EVT-001', 'Jakarta Open Championship 2025', NULL, 'GBK Arena Archery Center', 'https://maps.app.goo.gl/exampleJakarta', 'Jakarta', 'Jl. Jenderal Sudirman, Gelora Bung Karno, Jakarta Pusat', 'Jakarta Pusat', '2026-01-24 06:53:07', '2026-01-27 06:53:07', '2026-01-25 06:53:07', 'Jakarta Open Championship 2025 adalah salah satu kompetisi panahan tingkat internasional paling bergengsi di Indonesia. Event ini menghadirkan atlet-atlet terbaik dari berbagai negara untuk bertanding di ibu kota negara.', NULL, NULL, NULL, 1, 1, 300000.00, 600, 'ongoing', 'a1fdd1c4-632a-44d9-9be4-c96461e4530e', '2026-01-24 14:53:07', '2026-01-28 13:14:40', 20000000.00, 'https://archeryhub.id/docs/tpk-jakarta-2025.pdf', '{"sections":{"about":true,"divisions":true,"fees":true,"prizes":true,"schedule":true,"location":true},"prizes":{"first":"Rp 15.000.000 + Medali Emas","second":"Rp 10.000.000 + Medali Perak","third":"Rp 5.000.000 + Medali Perunggu"}}'),
	('64015ab4-f934-11f0-87db-c3c8a1ce2650', 'bandung-archery-festival-2025', 'EVT-002', 'Bandung Archery Festival 2025', NULL, 'Lapangan Panahan Saparua', 'https://maps.app.goo.gl/exampleBandung', 'Bandung', 'Jl. Saparua No. 1, Bandung', 'Bandung', '2026-01-24 06:53:08', '2026-01-26 06:53:08', '2026-01-25 06:53:08', 'Bandung Archery Festival 2025 adalah festival olahraga panahan yang menggabungkan kompetisi dengan hiburan. Selain pertandingan resmi, event ini juga menyediakan workshop panahan, pameran alat panah, dan kegiatan keluarga.', NULL, NULL, NULL, 1, 1, 400000.00, 300, 'ongoing', 'a1fdd1c4-632a-44d9-9be4-c96461e4530e', '2026-01-24 14:53:08', '2026-01-28 13:14:42', 30000000.00, 'https://archeryhub.id/docs/tpk-bandung-2025.pdf', '{"sections":{"about":true,"divisions":true,"fees":true,"prizes":true,"schedule":true,"location":true},"prizes":{"first":"Rp 3.000.000","second":"Rp 2.000.000","third":"Rp 1.000.000"}}'),
	('64c08cf0-f934-11f0-87db-c3c8a1ce2650', 'surabaya-national-cup-2025', 'EVT-003', 'Surabaya National Cup 2025', NULL, 'Stadion Gelora Bung Tomo', 'https://maps.app.goo.gl/exampleSurabaya', 'Surabaya', 'Jl. Pahlawan, Surabaya', 'Surabaya', '2026-01-24 06:53:10', '2026-01-28 06:53:10', '2026-01-25 06:53:10', 'Surabaya National Cup 2025 adalah kompetisi panahan tingkat nasional yang diselenggarakan di kota pahlawan. Event ini menjadi ajang unjuk kebolehan pemanah-pemanah terbaik Indonesia dari berbagai provinsi.', NULL, NULL, NULL, 1, 1, 200000.00, 500, 'ongoing', 'a1fdd1c4-632a-44d9-9be4-c96461e4530e', '2026-01-24 14:53:10', '2026-01-28 13:14:45', 30000000.00, 'https://archeryhub.id/docs/tpk-surabaya-2025.pdf', '{"sections":{"about":true,"divisions":true,"fees":true,"prizes":true,"schedule":true,"location":true},"prizes":{"first":"Rp 8.000.000","second":"Rp 5.000.000","third":"Rp 3.000.000"}}'),
	('656dbbc6-f934-11f0-87db-c3c8a1ce2650', 'yogyakarta-archery-open-2025', 'EVT-004', 'Yogyakarta Archery Open 2025', NULL, 'Lapangan Panahan UGM', 'https://maps.app.goo.gl/exampleYogyakarta', 'Yogyakarta', 'Kompleks Olahraga UGM, Sleman, Yogyakarta', 'Yogyakarta', '2026-01-24 06:53:11', '2026-01-27 06:53:11', '2026-01-25 06:53:11', 'Yogyakarta Archery Open 2025 adalah kompetisi terbuka yang diselenggarakan di kota pelajar. Event ini tidak hanya menjadi ajang kompetisi tetapi juga sarana pengembangan olahraga panahan di kalangan generasi muda.', NULL, NULL, NULL, 1, 1, 350000.00, 250, 'ongoing', 'a1fdd1c4-632a-44d9-9be4-c96461e4530e', '2026-01-24 14:53:11', '2026-01-28 13:14:48', 5000000.00, 'https://archeryhub.id/docs/tpk-yogyakarta-2025.pdf', '{"sections":{"about":true,"divisions":true,"fees":true,"prizes":true,"schedule":true,"location":true},"prizes":{"first":"Rp 2.500.000","second":"Rp 1.500.000","third":"Rp 1.000.000"}}'),
	('66288818-f934-11f0-87db-c3c8a1ce2650', 'bali-international-archery-2025', 'EVT-005', 'Bali International Archery 2025', NULL, 'Bali Archery Resort', 'https://maps.app.goo.gl/exampleBali', 'Denpasar, Bali', 'Jl. Sunset Road, Badung, Bali', 'Badung', '2026-01-24 06:53:12', '2026-01-29 06:53:12', '2026-01-26 06:53:12', 'Bali International Archery 2025 adalah kompetisi internasional yang mengundang pemanah dari berbagai negara ASEAN dan sekitarnya. Diselenggarakan di pulau dewata dengan pemandangan alam yang indah.', NULL, NULL, NULL, 1, 1, 250000.00, 400, 'ongoing', 'a1fdd1c4-632a-44d9-9be4-c96461e4530e', '2026-01-24 14:53:12', '2026-01-28 13:12:44', 20000000.00, 'https://archeryhub.id/docs/tpk-bali-2025.pdf', '{"sections":{"about":true,"divisions":true,"fees":true,"prizes":true,"schedule":true,"location":true},"prizes":{"first":"Rp 20.000.000 + Medali Emas","second":"Rp 12.000.000 + Medali Perak","third":"Rp 7.000.000 + Medali Perunggu"}}'),
	('670f9d9a-f934-11f0-87db-c3c8a1ce2650', 'medan-archery-championship-2025', 'EVT-006', 'Medan Archery Championship 2025', NULL, 'Lapangan Panahan KONI Sumut', 'https://maps.app.goo.gl/exampleMedan', 'Medan', 'Jl. Multatuli No. 12, Medan', 'Medan', '2026-01-24 06:53:13', '2026-01-28 06:53:13', '2026-01-25 06:53:13', 'Medan Archery Championship 2025 adalah kejuaraan panahan terbuka tingkat Sumatera Utara yang menghadirkan kompetisi berkualitas tinggi bagi pemanah-pemanah berbakat dari seluruh provinsi. Event ini menampilkan berbagai divisi kompetisi termasuk Recurve, Compound, Barebow, dan Nasional dengan kategori individu maupun tim. Setiap peserta akan berkesempatan untuk menunjukkan kemampuan terbaik mereka dalam sesi kualifikasi dan eliminasi yang dirancang dengan standar kompetisi internasional.', NULL, NULL, NULL, 1, 1, 300000.00, 300, 'ongoing', 'a1fdd1c4-632a-44d9-9be4-c96461e4530e', '2026-01-24 14:53:13', '2026-01-28 13:14:54', 25000000.00, 'https://archeryhub.id/docs/technical-guidebook-medan-archery-championship-2025.pdf', '{"sections": {"about": true, "divisions": true, "fees": true, "prizes": true, "schedule": true, "location": true}, "prizes": {"first": "Rp 15.000.000", "first_caption": "+ Piala + Medali Emas", "second": "Rp 10.000.000", "second_caption": "+ Piala + Medali Perak", "third": "Rp 7.500.000", "third_caption": "+ Piala + Medali Perunggu"}, "fees": [{"name": "Individu", "amount": 150000, "description": "Biaya pendaftaran untuk kategori individu per divisi"}, {"name": "Tim", "amount": 400000, "description": "Biaya pendaftaran untuk kategori tim (3 orang)"}, {"name": "Early Bird", "amount": 120000, "description": "Diskon 20% untuk pendaftaran sebelum 1 Februari 2025"}]}'),
	('f9272ae0-f76f-11f0-87db-c3c8a1ce2650', 'indonesian-open-championship-2025', 'IOC-2025', 'Indonesian Open Championship 2025', 'IOC 2025', 'Senayan Archery Center', 'https://maps.app.goo.gl/exampleSenayan', 'Jakarta, Indonesia', 'Kompleks Gelora Bung Karno, Jakarta', 'Jakarta', '2025-03-15 08:00:00', '2025-03-18 18:00:00', '2025-03-10 23:59:59', 'Indonesian Open Championship 2025 adalah kompetisi panahan nasional terbesar yang menghadirkan pemanah-pemanah elit dari seluruh Indonesia. Event ini juga menjadi ajang seleksi timnas untuk kejuaraan internasional.', 'https://images.unsplash.com/photo-1578662996442-48f60103fc96?w=1920&h=1080&fit=crop', 'https://images.unsplash.com/photo-1606107557195-0e29a4b5b4aa?w=400&h=400&fit=crop', 'Outdoor', 2, 3, 250000.00, 800, 'published', 'a1fdd1c4-632a-44d9-9be4-c96461e4530e', '2026-01-22 08:54:37', '2026-01-28 13:14:55', 20000000.00, 'https://archeryhub.id/docs/tpk-indonesia-2025.pdf', '{"sections":{"about":true,"divisions":true,"fees":true,"prizes":true,"schedule":true,"location":true},"prizes":{"first":"Rp 25.000.000 + Medali Emas","second":"Rp 15.000.000 + Medali Perak","third":"Rp 10.000.000 + Medali Perunggu"}}');
