INSERT INTO `news` (`uuid`, `organization_id`, `club_id`, `title`, `slug`, `excerpt`, `content`, `image_url`, `category`, `status`, `views`, `author_name`, `author_id`, `meta_title`, `meta_description`, `published_at`, `created_at`, `updated_at`) VALUES
	('452c2d35-f935-11f0-87db-c3c8a1ce2650', NULL, '6a108a88-f934-11f0-87db-c3c8a1ce2650', 'Atlet Indonesia Raih Medali Emas di Asian Games 2025', 'atlet-indonesia-raih-medali-emas-di-asian-games-2025', 'Prestasi membanggakan! Atlet panahan Indonesia berhasil meraih medali emas di kategori Recurve Men pada Asian Games 2025.', 'Prestasi membanggakan datang dari atlet panahan Indonesia yang berhasil meraih medali emas di kategori Recurve Men pada Asian Games 2025. Atlet tersebut menunjukkan performa luar biasa dengan skor total 685 poin, mengalahkan kompetitor dari Korea Selatan dan Jepang.', NULL, 'prestasi', 'published', 0, 'Tim Redaksi ArcheryHub', NULL, NULL, NULL, '2026-01-24 14:59:26', '2026-01-24 14:59:26', '2026-01-27 08:12:40'),
	('4543e2a8-f935-11f0-87db-c3c8a1ce2650', '34d712a4-f992-11f0-87db-c3c8a1ce2650', NULL, 'Kejuaraan Nasional Panahan 2025 Resmi Dibuka', 'kejuaraan-nasional-panahan-2025-resmi-dibuka', 'Kejuaraan Nasional Panahan 2025 telah resmi dibuka dengan partisipasi lebih dari 500 atlet dari seluruh Indonesia.', 'Kejuaraan Nasional Panahan 2025 telah resmi dibuka hari ini dengan partisipasi lebih dari 500 atlet dari seluruh Indonesia. Event yang diselenggarakan di GBK Senayan, Jakarta ini akan berlangsung selama 5 hari dan menampilkan berbagai kategori mulai dari Recurve, Compound, hingga Traditional Bow.', NULL, 'event', 'published', 0, 'Tim Redaksi ArcheryHub', NULL, NULL, NULL, '2026-01-24 14:59:26', '2026-01-24 14:59:26', '2026-01-27 08:12:42'),
	('457d1c97-f935-11f0-87db-c3c8a1ce2650', NULL, '218e8243-6e03-41b3-a551-65936bd12815', 'Pendaftaran Jakarta Open Championship 2025 Dibuka', 'pendaftaran-jakarta-open-championship-2025-dibuka', 'Pendaftaran untuk Jakarta Open Championship 2025 telah dibuka. Event ini akan diselenggarakan pada bulan Februari 2025.', 'Pendaftaran untuk Jakarta Open Championship 2025 telah resmi dibuka. Event bergengsi ini akan diselenggarakan di GBK Senayan pada bulan Februari 2025. Segera daftarkan diri Anda untuk mendapatkan slot terbaik!', NULL, 'pengumuman', 'published', 0, 'Tim Redaksi ArcheryHub', NULL, NULL, NULL, '2026-01-24 14:59:27', '2026-01-24 14:59:27', '2026-01-27 08:12:44'),
	('4659d2f5-f935-11f0-87db-c3c8a1ce2650', '34d7162e-f992-11f0-87db-c3c8a1ce2650', NULL, 'Workshop Teknik Panahan Modern untuk Pelatih', 'workshop-teknik-panahan-modern-untuk-pelatih', 'Workshop khusus untuk pelatih panahan akan diselenggarakan untuk meningkatkan kualitas pelatihan di Indonesia.', 'Workshop teknik panahan modern akan diselenggarakan khusus untuk para pelatih panahan di seluruh Indonesia. Workshop ini akan membahas teknik-teknik terbaru dalam pelatihan panahan, manajemen atlet, dan strategi pengembangan bakat.', NULL, 'pengumuman', 'published', 0, 'Tim Redaksi ArcheryHub', NULL, NULL, NULL, '2026-01-24 14:59:28', '2026-01-24 14:59:28', '2026-01-27 08:12:46'),
	('48751ea6-f935-11f0-87db-c3c8a1ce2650', NULL, '6a108a88-f934-11f0-87db-c3c8a1ce2650', 'Klub Jakarta Elite Archery Raih Juara Umum', 'klub-jakarta-elite-archery-raih-juara-umum', 'Klub Jakarta Elite Archery berhasil meraih juara umum pada Kejuaraan Antar Klub Nasional 2025.', 'Klub Jakarta Elite Archery berhasil meraih juara umum pada Kejuaraan Antar Klub Nasional 2025 yang diselenggarakan di Bandung. Klub ini berhasil mengumpulkan total 12 medali terdiri dari 5 emas, 4 perak, dan 3 perunggu.', NULL, 'prestasi', 'published', 0, 'Tim Redaksi ArcheryHub', NULL, NULL, NULL, '2026-01-24 14:59:32', '2026-01-24 14:59:32', '2026-01-27 08:12:47'),
	('487535c3-f935-11f0-87db-c3c8a1ce2650', '34d717bf-f992-11f0-87db-c3c8a1ce2650', NULL, 'Teknologi Baru dalam Peralatan Panahan', 'teknologi-baru-dalam-peralatan-panahan', 'Perkembangan teknologi terbaru dalam peralatan panahan modern yang dapat meningkatkan performa atlet.', 'Perkembangan teknologi terus membawa inovasi dalam dunia panahan. Peralatan terbaru seperti busur dengan teknologi carbon fiber, sight dengan sistem digital, dan arrow dengan aerodinamika yang lebih baik telah membantu atlet mencapai performa optimal.', NULL, 'lainnya', 'published', 0, 'Tim Redaksi ArcheryHub', NULL, NULL, NULL, '2026-01-24 14:59:32', '2026-01-24 14:59:32', '2026-01-27 08:12:50'),
	('48b24529-f935-11f0-87db-c3c8a1ce2650', '34d717bf-f992-11f0-87db-c3c8a1ce2650', NULL, 'Program Pengembangan Atlet Muda Panahan', 'program-pengembangan-atlet-muda-panahan', 'Program khusus untuk mengembangkan bakat atlet muda panahan Indonesia diluncurkan.', 'Program pengembangan atlet muda panahan telah diluncurkan untuk memberikan pelatihan intensif kepada atlet-atlet berbakat di usia muda. Program ini bertujuan untuk mencetak atlet-atlet berprestasi yang dapat mewakili Indonesia di kompetisi internasional.', NULL, 'pengumuman', 'published', 0, 'Tim Redaksi ArcheryHub', NULL, NULL, NULL, '2026-01-24 14:59:32', '2026-01-24 14:59:32', '2026-01-27 08:12:50'),
	('4a1260d6-f935-11f0-87db-c3c8a1ce2650', NULL, '6c839327-f934-11f0-87db-c3c8a1ce2650', 'Tips Meningkatkan Akurasi dalam Panahan', 'tips-meningkatkan-akurasi-dalam-panahan', 'Panduan lengkap untuk meningkatkan akurasi dan konsistensi dalam memanah.', 'Meningkatkan akurasi dalam panahan memerlukan latihan yang konsisten dan teknik yang tepat. Artikel ini membahas berbagai tips dan teknik yang dapat membantu pemanah meningkatkan akurasi, mulai dari postur tubuh, teknik menarik, hingga fokus mental.', NULL, 'lainnya', 'published', 0, 'Tim Redaksi ArcheryHub', NULL, NULL, NULL, '2026-01-24 14:59:34', '2026-01-24 14:59:34', '2026-01-27 08:12:51');
